import React from "react";
import { Link } from "react-router-dom";
import "../styles/app.css";
import PersonQuestionnaire from "./PersonQuestionnaire";
import DogQuestionnaire from "./DogQuestionnaire";

const App = () => {
  return (
    <div className="App">
      <h1>Pawfect Match</h1>
      <nav>
        <ul>
          <li>
            <link to="./DogQuestionnaire" />
          </li>
          <li>
            <PersonQuestionnaire />
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default App;
